import Header from './components/player/Player';
import "./index.css"
import Player from './components/player/Player';

function App() {
  return (
    <section>
      <menu>
        <div className="game-container">
          <ol id="players" type='1'>
            <Player name="Player 1" symbol="1"/>
            <Player name="Player 2" symbol="2"/>    
          </ol>
        </div>

      </menu>
    </section>


  );
}

export default App;
